import Profile from '../views/user/Profile'
import Login from '../views/user/Login'
export default [
    {
      path: '/',
      name: 'Login',
      component: Login,
      meta: {
         allowAnonymous: true
      }
    },
   {
      path: '/profile',
      name: 'Profile',
      component: Profile,
      beforeEnter: (to, from, next) => {
        if (!store.state.userIsLogged) next({ path: '/', replace: true })
        else next()
      }
    }
   ]
